import React from 'react';
import '../css/navproductos.css';

const ElementoNavProductos = ({ onSelectCategory }) => {
  const categories = ['Todos', 'Caballeros', 'Damas', 'Ni単os', 'Ni単as', 'Unisex'];

  return (
    <nav className="nav-productos">
      {categories.map(category => (
        <button 
          key={category} 
          onClick={() => onSelectCategory(category)}
          className="nav-productos-btn"
        >
          {category}
        </button>
      ))}
    </nav>
  );
};

export default ElementoNavProductos;
